***** ПОТРЯСАЮЩИЙ ТЕСТ! - ИЗВЛЕКАЕТ ПРАВДУ ИЗ ПОДСОЗНАНИЯ! *****
Пройди этот тест, и ты будешь поражен результатам, которые отражают как генетическое наследие, так и текущее состояние.
Регулярное тестирование позволит тебе глубже понимать свое подсознание и смены настроения.

***** КЕМ БЫТЬ? ДА, ТЕСТ ОТВЕТИТ И НА ЭТОТ ВОПРОС! *****
В результате теста будет предоставлен список наиболее подходящих тебе профессий. 

***** УЗНАЙ НАСКОЛЬКО НОРМАЛЬНО ТВОЕ ПОВЕДЕНИЕ? *****
Пройдя тест 10 раз (не чаще одного раза в день), ты получишь коэффициент напряженности, который расскажет все о твоем поведении. Насколько оно нормальное? А может заторможенное, или слишком возбужденное?
Ответ в тесте!

***** РАЗРАБАТЫВАЛСЯ 12 ЛЕТ КОЛЛЕКТИВОМ БОЛЕЕ 30 СПЕЦИАЛИСТОВ!*****
Тест Сонди это:
- потрясающе точный тест, извлекающий данные из подсознания;
- не требует умственного напряжения, легко проводится, но дает шокирующе точные результаты;
- проходи тест периодически, чтобы лучше понимать себя;
- прекрасная возможность узнать правду о себе и своих близких;
- активно используется широким кругом специалистов, в том числе психологами, психиатрами, менеджерами по персоналу, спецслужбами и т.д.
- тест создавался на протяжении 12 лет коллективом более 30 человек.

***** О ТЕСТЕ *****
Этот тест разработан швейцарским врачом, психоаналитиком и психологом Леопольдом Сонди в 1937 году (начал работать над созданием теста в 1925 году).
Тест предназначен для работы с детьми старше 10 лет и взрослыми. Тест Сонди универсален и может использоваться для людей любой национальности и социально-региональной принадлежности.
В тесте представлены 48 портретов людей с психическими расстройствами (гомосексуализм, садизм, эпилепсия, истерия, кататоническая форма шизофрении, параноидная шизофрения, депрессия, мания). Портреты разделены на шесть серий по восемь штук (по одному портрету от каждой категории больных). Во всех сериях портретов необходимо выбрать по два наиболее и наименее понравившихся.
Время на раздумье должно быть ограничено, важна первая непосредственная реакция.

Время проведения: 15-20 мин.

**** ЛУЧШАЯ ВЕРСИЯ В APPSTORE *****
Главные преимущества этой версии теста:
- неограниченное количество пользователей и тестирований;
- максимально углубленный анализ исходных данных с учетом их взаимного влияния друг на друга. Для этого реализован механизм двухпроходного анализа полученных данных;
- результат содержит разъяснение каждого фактора и анализ по нему в развернутом виде;
- даны разъяснения узкоспециализированных терминов;
- в результат включены рекомендуемые профессии;
- автоматически сохраняются 10 последних результатов тестирования, что позволяет отслеживать изменения твоего психологического состояния;
- сохраненные результаты можно выборочно удалять;
- также результат дополнительно можно отправить на e-mail; 
- приложение поддерживает портретный и ландшафтный режимы на всех устройствах.

Many fun and surprising events with the beloved characters await your child! Explore the colorful world of the game for boys and girls alike!

Travel through a three-dimensional interactive enchanted forest where captivating entertainment awaits your child at every turn. Along your way you'll find interactive items which will allow your child to satisfy their eagerness to explore and discover safely.

With a tap of your finger, the friends spring to life and set out on a fascinating journey filled with happy meetings, engaging quests, and educational entertainment!

Educational mini-games are fun and contribute to children’s development!
• Inventing is fun! Help Bucky build a boat;
• There's so much to see in the forest! Take your camera and join the bears on a photo hunt;
• Cleaning can be fun too! Help tidy up in Bjorn's room;
• The forest looks beautiful in fall! Clear the colorful leaves off the playground;
• The lake will keep you busy even in winter! Feed the hungry fish;
• There's a lot of snow! Clear the snow from Bjorn's backyard.

